import "./Header.css";

function Header() {
  return (
    <header>
      <h1>Archivist</h1>
      <h2>
        A Character Leveling Companion App
        <br />
        for Dungeons & Dragons 5th Edition
      </h2>
    </header>
  );
}

export default Header;
